4	1	Peking duck	Sample recipe found on: https://www.allrecipes.com/recipe/31972/peking-duck/\n\nSample description: This Peking duck recipe is delicious. The roast duck can be served with plum sauce or other fruit sauce. This is a short-cut version, but it is fantastic.\n\nNote:\n- still unable to add fractional quantities, meaning nothing less than 1	data:image/jpeg;base64,	published	<ol><li>Rinse duck inside and out; pat dry. Cut off tail and discard.<br>&nbsp;</li><li>Mix together cinnamon, ginger, nutmeg, white pepper, and cloves in a small bowl. Sprinkle 1 teaspoon spice mixture into cavity of duck. Stir 1 tablespoon soy sauce into remaining spice mixture and rub evenly over entire outside of duck. Cut 1 green onion in half and tuck it inside cavity. Cover and refrigerate duck for at least 2 hours or up to overnight.<br>&nbsp;</li><li>Place duck breast-side up on a rack set in a wok or pot. Steam for 1 hour, adding more water as it evaporates. Lift duck with two large spoons to drain juices and green onion. Place duck breast-side up in a roasting pan and prick skin all over with a fork.<br>&nbsp;</li><li>Preheat the oven to 375 degrees F (190 degrees C).<br>&nbsp;</li><li>Roast duck in the preheated oven for 30 minutes.<br>&nbsp;</li><li>Mix together remaining 2 tablespoons soy sauce and honey in a small bowl. Brush honey mixture onto duck.<br>&nbsp;</li><li>Increase the oven temperature to 500 degrees F (260 degrees C). Roast until skin is richly browned, about 5 minutes. Do not allow skin to char.<br>&nbsp;</li><li>Mix together plum jam, chutney, sugar, and vinegar in a small serving bowl. Chop remaining green onions and place them into a separate bowl.<br>&nbsp;</li><li>Place whole duck onto a serving platter and garnish with orange slices and fresh parsley. Serve with plum sauce and chopped green onions.<br>&nbsp;</li></ol>	2022-11-08 14:34:30.87581	2022-11-08 14:50:03.842665	3	50	4	\N	\N	\N	\N	Chinese	f	f	t	f	f	f	f	f	f	f	f	f	f	f
1	1	Beef Lasagne	Sample recipe found on: https://www.taste.com.au/recipes/our-favourite-lasagne/2ac35c7f-3320-48ef-b2cb-ecef75883241\n\nUsed to test effectiveness of recipe formatting	data:image/jpeg;base64,	published	<ul><li><strong>Step 1</strong></li></ul><p>Heat the <strong>oil </strong>in a large frying pan over medium heat. Add the <strong>onion </strong>and <strong>garlic </strong>and cook, stirring, for 5 minutes or until onion softens. Add the <strong>mince </strong>and cook, stirring with a wooden spoon to break up any lumps, for 5 minutes or until mince changes colour. Add the <strong>tomato </strong>, <strong>wine </strong>and <strong>tomato paste </strong>, and bring to the boil. Reduce heat to low. Simmer, uncovered, stirring occasionally, for 30 minutes or until sauce thickens slightly. Remove from heat. Taste and season with <strong>salt and pepper </strong>.</p><ul><li><strong>Step 2</strong></li></ul><p>Meanwhile, to make the cheese sauce, combine the <strong>milk </strong>, <strong>onion </strong>, <strong>parsley stalks </strong>, <strong>peppercorns </strong>, <strong>cloves </strong>and <strong>bay leaves </strong>in a medium saucepan and bring to a simmer over medium heat. Remove from heat and set aside for 15 minutes to infuse.</p><ul><li><strong>Step 3</strong></li></ul><p>Strain the milk mixture through a fine sieve into a large jug. Discard solids.</p><ul><li><strong>Step 4</strong></li></ul><p>Melt the <strong>butter </strong>in a large saucepan over medium-high heat until foaming. Add the <strong>flour </strong>and cook, stirring, for 1-2 minutes or until mixture bubbles and begins to come away from the side of the pan. Remove from heat.</p><ul><li><strong>Step 5</strong></li></ul><p>Gradually pour in half the milk, whisking constantly with a balloon whisk, until mixture is smooth. Gradually add the remaining milk, whisking until smooth and combined.</p><ul><li><strong>Step 6</strong></li></ul><p>Place saucepan over medium-high heat and bring to the boil, stirring constantly with a wooden spoon, for 5 minutes or until sauce thickens and coats the back of the spoon. Remove from heat. Add the <strong>parmesan </strong>and stir until cheese melts. Taste and season with <strong>nutmeg </strong>, <strong>salt and white pepper </strong>.</p><ul><li><strong>Step 7</strong></li></ul><p>Preheat oven to 180°C. Brush a rectangular 3L (12 cup) capacity ovenproof dish with <strong>oil </strong>to lightly grease. Spread one-quarter of the bechamel sauce over the base of the prepared dish. Arrange 1 lasagne sheet over the sauce. Top with one-third of the mince mixture and one-third of the remaining bechamel sauce. Continue layering with the remaining lasagne sheets, mince mixture and bechamel, finishing with a layer of bechamel. Sprinkle with <strong>mozzarella </strong>. Place on a baking tray. Bake in preheated oven for 40 minutes or until cheese melts, is golden brown, and the edges are bubbling. Remove from oven and set aside for 10 minutes to set.</p><ul><li><strong>Step 8</strong></li></ul><p>Cut the lasagne into 8 portions and serve with <strong>mixed salad leaves </strong>.</p>	2022-11-06 15:36:29.377477	2022-11-17 13:21:26.926013	1	40	8	\N	\N	\N	\N	Italian	f	f	t	f	f	f	f	f	f	f	t	f	f	f
5	2	Glazed doughnuts	Sample recipe found on: https://sallysbakingaddiction.com/how-to-make-homemade-glazed-doughnuts/\n\nNotes: regular issues found in other recipes, reference has interesting applications of notes with links to guides. Reminiscent of KitchenStories	data:image/jpeg;base64,	published	<h2>Instructions</h2><ol><li><strong>Prepare the dough:</strong> Whisk the warm milk, yeast, and sugar together in the bowl of your stand mixer fitted with a dough hook or paddle attachment. Cover and allow to sit for 5 minutes. The mixture should be a little frothy on top after 5 minutes. If not, start over with new yeast.<br>&nbsp;</li><li>Add the eggs, butter, vanilla, nutmeg, salt, and 2 cups (245g) flour. Beat on low speed for 1 minute. Scrape down the sides of the bowl with a rubber spatula as needed. Add remaining flour and beat on medium speed until the dough comes together and pulls away from the sides of the bowl, about 2 minutes. If needed, add more flour, 1 Tablespoon at a time, until the dough pulls away from the sides of the bowl. Don’t add too much flour, though. You want a slightly sticky dough. <i>*If you do not own a mixer, you can mix this dough with a large wooden spoon or rubber spatula. It will take a bit of arm muscle!*</i><br>&nbsp;</li><li><strong>Knead the dough:</strong> Keep the dough in the mixer and beat for an additional 2 minutes or knead by hand on a lightly floured surface for 2 minutes.<br>&nbsp;</li><li><strong>Let Dough Rise:</strong> Lightly grease a large bowl with oil or nonstick spray. Place the dough in the bowl, turning it to coat all sides in the oil. Cover the bowl with aluminum foil, plastic wrap, or a clean kitchen towel. Allow the dough to rise in a relatively warm environment for 1.5-2 hours or until double in size.<br>&nbsp;</li><li><strong>Shape Doughnuts: </strong>When the dough is ready, punch it down to release the air.Remove dough from the bowl and turn it out onto a lightly floured surface. If needed, punch down again to release any more air bubbles. Using a rolling pin, roll the dough out until it is 1/2 inch thick. Using a 3-3.5 inch doughnut cutter, cut into 12 doughnuts. If you can’t quite fit 12, re-roll the scraps and cut more.<br>&nbsp;</li><li>Line 1 or 2 baking sheets with parchment paper or silicone baking mats. Place doughnuts and doughnut holes on each. (Feel free to discard doughnut holes if desired.) Loosely cover and allow to rest as you heat the oil. They will rise a bit as they rest. Place a cooling rack over another baking sheet.<br>&nbsp;</li><li>Pour oil into a large heavy-duty pot set over medium heat. Heat oil to 375°F (191°C). Add 2-3 doughnuts at a time and cook for 1 minute on each side. Carefully remove with a metal spatula or metal slotted spoon. Wear kitchen gloves if oil is splashing. Place fried doughnuts onto prepared rack. Repeat with remaining doughnuts, then turn off heat.* (See note for doughnut holes.)<br>&nbsp;</li><li><strong>Make the glaze:</strong> Whisk all of the glaze ingredients together. Dip each warm doughnut (don’t wait for them to cool!) into the glaze, making sure to coat both sides. Place back onto prepared rack as excess glaze drips down. After about 20 minutes, the glaze will set + harden.<br>&nbsp;</li><li>Doughnuts are best enjoyed the same day. You can store in an airtight container at room temperature or in the refrigerator for 1-2 extra days.</li></ol><h2>Notes</h2><ol><li><strong>Freezing Instructions:</strong> Prepare recipe through step 5. Freeze shaped doughnuts for up to 3 months. On the day you serve them, let the doughnuts thaw and rest at room temperature for about 4-5 hours. Fry as directed. You can also freeze the fried doughnuts (unglazed). Allow them to cool completely, then freeze for up to 3 months. Thaw in the refrigerator or at room temperature, then reheat as desired (microwave is great) and dunk in glaze.<br>&nbsp;</li><li><strong>Overnight Instructions: </strong>Complete dough through step 3. Instead of allowing to rise in a warm environment in step 4, place the covered dough into the refrigerator overnight (8-12 hours). The next morning, remove from the refrigerator and allow to rise in a warm environment until doubled. The dough will lightly rise in the refrigerator overnight, so the rise the next morning won’t be too long. After rising, continue with step 5.<br>&nbsp;</li><li><strong>Doughnut Holes:</strong> Add holes to hot oil and fry until golden, about 30 seconds, on each side.<br>&nbsp;</li><li><strong>Milk:</strong> Whole milk is a must for the most tender dough– or you can try buttermilk. Lower fat or nondairy milks work in a pinch, but the doughnuts aren’t as flavorful or rich.<br>&nbsp;</li><li><strong>Yeast:</strong> If using an instant yeast, your rise time will be a little shorter. Reference my <strong>Baking with Yeast Guide</strong> for answers to common yeast FAQs.<br>&nbsp;</li><li><strong>Oil:</strong> The amount of oil really depends on how wide or tall your pot is. You want oil to fill about 1/3 of the pot. I use a little more than 1 quart for my 4 and 1/2 quart Dutch oven.<br>&nbsp;</li><li><strong>Special Tools</strong> (affiliate links):&nbsp;Large, heavy bottomed pot or <strong>Dutch oven</strong>, <strong>high-heat thermometer</strong> (I love this <strong>thermometer</strong> too), and a&nbsp;<strong>doughnut cutter</strong>. If you don’t have a doughnut cutter, you can use 1 large + 1 smaller circle cookie cutter (large should be about 3 and 1/2 inches)<br>&nbsp;</li><li><strong>Leftover Oil:</strong> Do not pour used oil down the sink drain. Allow to cool, then pour into an empty container and discard in the trash or reuse it.</li></ol>	2022-11-08 15:10:07.486228	2022-11-17 13:50:00.196119	2	\N	12	\N	\N	\N	\N	Dessert	f	f	f	t	t	f	f	f	f	f	f	f	t	t
6	3	Ratatouille	Sample recipe found from: https://www.jamieoliver.com/recipes/vegetables-recipes/classic-ratatouille/\n\n*Could not add eggplants to recipe. \n	data:image/jpeg;base64,	published	<ol><li>Prep your ingredients before you start – peel and cut the onions into wedges, then peel and finely slice the garlic. Trim the aubergines and courgettes, deseed the peppers and chop into 2.5cm chunks. Roughly chop the tomatoes. Pick the basil leaves and set aside, then finely slice the stalks.</li><li>Heat 2 tablespoons of oil in a large casserole pan or saucepan over a medium heat, add the chopped aubergines, courgettes and peppers (you may need to do this in batches) and fry for around 5 minutes, or until golden and softened, but not cooked through. Spoon the cooked veg into a large bowl.</li><li>To the pan, add the onion, garlic, basil stalks and thyme leaves with another drizzle of oil, if needed. Fry for 10 to 15 minutes, or until softened and golden.</li><li>Return the cooked veg to the pan and stir in the fresh and tinned tomatoes, the balsamic and a good pinch of sea salt and black pepper.</li><li>Mix well, breaking up the tomatoes with the back of a spoon. Cover the pan and simmer over a low heat for 30 to 35 minutes, or until reduced, sticky and sweet.</li><li>Tear in the basil leaves, finely grate in the lemon zest and adjust the seasoning, if needed. Serve with a hunk of bread or steamed rice.</li></ol>	2022-11-13 11:50:22.488058	2022-11-13 11:58:19.653987	1	15	4	\N	\N	\N	\N	French	f	f	t	f	t	t	t	t	t	t	t	t	t	t
7	4	Dumplings	Sample recipe found from: https://www.kannammacooks.com/kung-fu-panda-dumplings-recipe/	data:image/jpeg;base64,	published	<ol><li>Take a bowl and add in the flour, salt and a teaspoon of oil. Add in the hot water and mix well. Knead the dough for 3-4 minutes until soft and pliable. Apply half a teaspoon of oil on the dough so the dough does not dry out. Store the dough to rest over night in the refrigerator. Remove the dough couple of hours before from the refrigerator and let it come to room temperature.<br>&nbsp;</li><li>Mix all the ingredients listed under filling. Combine well. Set aside.<br>&nbsp;</li><li>Dust the work surface with flour and roll the dough into thin sheets. Cut small rounds from them. Set aside the rounds. Cover the wrappers with parchment or cling wrap so the wrappers don’t stick with one another. Repeat until all the dough has been cut out.<br>&nbsp;</li><li>Place 1 tablespoon of filling on each dumpling wrapper. Pleat the dough to form dumpling.<br>&nbsp;</li><li>Steam the dumplings in a cabbage lined steamer for 12 minutes.<br>&nbsp;</li><li>Serve hot.</li></ol>	2022-11-17 13:05:07.962527	2022-11-17 13:11:24.573578	2	20	20	\N	\N	\N	\N	Chinese	f	t	t	f	f	f	f	f	f	f	f	f	f	f
2	1	Chocolate Cake	Sample recipe found from: https://www.taste.com.au/recipes/quick-mix-chocolate-cake-2/555a57b7-fd53-4b42-83df-a3250b840618\n\nUsed to test effectiveness of recipe formatting\n\nNotes:\n- unable to enter in fractional quantities for intgredients (e.g. 3/4 cup milk)\n- unable to distinguish between ingredients for the chocolate icing and cake\n- mandatory unit field means "3 pieces eggs" instead of "3 eggs" which is silly\n\nTaste has a recipe notes section at the end, like an appendix which is great.	data:image/jpeg;base64,	published	<ul><li><strong>Step 1</strong></li></ul><p>Preheat oven to 160°C. Brush a deep, square, 19cm (base measurement) cake pan (see tip below) with the <strong>melted butter </strong>to lightly grease. Line the base and sides of the pan with non-stick baking paper.</p><ul><li><strong>Step 2</strong></li></ul><p>Place the <strong>sugar </strong>, <strong>milk </strong>and <strong>butter </strong>in a large saucepan. Use a fine sieve to sift the <strong>cocoa powder </strong>and <strong>bicarbonate of soda </strong>over the mixture. Place the pan over medium-low heat and use a whisk to stir until the mixture is smooth (don't boil the mixture). (Alternatively, see microwave tip in the notes.) Remove the pan from the heat and set aside for 5 minutes to cool slightly.</p><ul><li><strong>Step 3</strong></li></ul><p>Use a sieve to sift half of each the self-raising and plain <strong>flours </strong>into the pan. Use the whisk to stir until the mixture is smooth. Repeat with the remaining flours. Add the <strong>eggs </strong>and continue to stir until well combined.</p><ul><li><strong>Step 4</strong></li></ul><p>Pour the mixture into the prepared cake pan and gently tap the pan on a bench to release any large air bubbles. Bake in preheated oven for 45-55 minutes or until a skewer inserted in the centre of the cake comes out clean. Set aside for 2 minutes before turning onto a wire rack. Set aside for 1 3/4 hours or until completely cool.</p><ul><li><strong>Step 5</strong></li></ul><p>To make the chocolate icing, sift the <strong>icing sugar </strong>and <strong>cocoa powder </strong>into a medium bowl. Add the <strong>butter </strong>and <strong>water </strong>, and stir with a wooden spoon until smooth. Use the back of a spoon or palette knife to spread the icing evenly over the top of the cooled cake. Set aside for about 50 minutes or until the icing is firm.</p>	2022-11-08 12:50:09.06862	2022-11-17 13:20:49.603493	1	5	8	\N	\N	\N	\N	Dessert	f	f	f	t	t	f	f	f	f	f	f	f	t	f
8	5	Lasagne	Sample recipe found from: https://www.bbcgoodfood.com/recipes/lasagne	data:image/jpeg;base64,	published	<p>&nbsp;</p><ol><li>First, make the béchamel sauce. Put the milk, onion, bay leaves and cloves into a large saucepan and bring very gently just up to the boil. Turn off the heat and set aside for 1 hr to infuse.<br>&nbsp;</li><li>For the meat sauce, put the oil, celery, onion, carrot, garlic and pancetta in another large saucepan. Gently cook together until the veg is soft but not coloured.<br>&nbsp;</li><li>Tip in the beef and pork mince, the milk and chopped tomatoes. Using a wooden spoon, stir together and break up and mash the lumps of mince against the sides of the pan. When the mince is mostly broken down, stir in all the herbs, the stock cubes and the red wine, and bring to a simmer. Cover and cook for 1 hr, stirring occasionally to stop the bottom catching.<br>&nbsp;</li><li>Uncover and gently simmer for another 30 mins-1 hr until the meat is tender and saucy. Taste and season.<br>&nbsp;</li><li>To finish the béchamel sauce, strain the milk through a fine sieve into one or two jugs. Melt the butter in the same pan then, using a wooden spoon, mix in the flour and cook for 2 mins.<br>&nbsp;</li><li>Stir in the strained milk, a little at a time – the mix will thicken at first to a doughy paste, but keep going, adding milk gradually to avoid lumps. Bring to a gentle simmer, stirring constantly (if you have lumps, give it a quick whisk). Gently bubble for a few minutes until thickened. Season with salt, pepper and a good grating of nutmeg.<br>&nbsp;</li><li>Heat the oven to 180C/160C fan/gas 4. Spread a spoonful of the meat sauce over the base of a roughly 3.5-litre baking dish. Cover with a single layer of dried pasta sheets, snapping them to fit if needed, then top with a quarter of the béchamel. Spoon over a third of the meat sauce and scatter over a little of the parmesan.<br>&nbsp;</li><li>Repeat the layers – pasta, béchamel, meat and parmesan – two more times to use all the meat sauce. Add a final layer of pasta, the last of the béchamel and remaining parmesan. Sit the dish on a baking tray to catch spills and bake for 1 hr until bubbling, browned and crisp on top.</li></ol>	2022-11-17 13:18:20.723394	2022-11-17 13:28:25.585235	4	10	8	\N	\N	\N	\N	Italian	f	f	t	f	f	f	f	f	f	f	f	f	f	f
9	6	Chocolate Chip Cookies	Sample recipe found from: https://sallysbakingaddiction.com/chewy-chocolate-chip-cookies/	data:image/jpeg;base64,	published	<ol><li>Whisk the flour, baking soda, cornstarch, and salt together in a large bowl. Set aside.<br>&nbsp;</li><li>In a medium bowl, whisk the melted butter, brown sugar, and granulated sugar together until no brown sugar lumps remain. Whisk in the egg and egg yolk. Finally, whisk in the vanilla extract. The mixture will be thin. Pour into dry ingredients and mix together with a large spoon or rubber spatula. The dough will be very soft, thick, and appear greasy. Fold in the chocolate chips. The chocolate chips may not stick to the dough because of the melted butter, but do your best to combine them.<br>&nbsp;</li><li>Cover the dough tightly and chill in the refrigerator for at least 2–3 hours or up to 3 days. I highly recommend chilling the cookie dough overnight for less spreading.<br>&nbsp;</li><li>Take the dough out of the refrigerator and allow it to slightly soften at room temperature for 10 minutes.<br>&nbsp;</li><li>Preheat oven to <strong>325°F (163°C)</strong>. Line large baking sheets with parchment paper or silicone baking mats. Set aside.<br>&nbsp;</li><li>Using a cookie scoop or Tablespoon measuring spoon, measure 3 scant Tablespoons (about 2 ounces, or 60g) of dough for XL cookies or 2 heaping Tablespoons (about 1.75 ounces, or 50g) of dough for medium/large cookies. Roll into a ball, making sure the shape is taller rather than wide—almost like a cylinder. This helps the cookies bake up thicker. Repeat with remaining dough. Place 8–9 balls of dough onto each cookie sheet.<br>&nbsp;</li><li>Bake the cookies for 12–13 minutes or until the edges are very lightly browned. (XL cookies can take closer to 14 minutes.) The centers will look very soft, but the cookies will continue to set as they cool. Cool on the baking sheet for 10 minutes. Meanwhile, press a few extra chocolate chips into the tops of the warm cookies. This is optional and only for looks. After 10 minutes of cooling on the baking sheets, transfer cookies to a wire rack to cool completely.<br>&nbsp;</li><li>Cookies stay fresh covered at room temperature for up to 1 week.</li></ol>	2022-11-17 13:41:55.981392	2022-11-17 13:45:58.528723	3	20	20	\N	\N	\N	\N	Dessert	f	f	f	t	f	f	f	f	f	f	f	f	f	f
10	7	If Looks Could Kale Burger	Sample recipe found from: https://www.connoisseurusveg.com/garlicky-kale-burgers/	data:image/jpeg;base64,	published	<ol><li>Clean and remove stems from kale, then tear the leaves into 2 inch pieces. Place into a steaming device of your choice (stovetop or microwave), and steam until leaves are just wilted and bright green, about 5 minutes.<br>&nbsp;</li><li>Place kale leaves into food processor bowl, along with beans, 1 cup panko, sunflower seeds, basil, garlic and lemon juice. Pulse a few times until well blended, stopping to scrape down sides of bowl as needed. Add up to an additional ¼ cup of panko if mixture seems too soft. Season the mixture with salt and pepper to taste.<br>&nbsp;</li><li>Shape the mixture into 4 to 6 patties.<br>&nbsp;</li><li>Lightly oil the bottom of a medium skillet and place over medium heat. Working in batches if needed, place patties into skillet and cook until browned on bottoms, about 4 minutes. Flip and cook until browned on opposite sides, about 4 minutes more.<br>&nbsp;</li><li>Stuff into buns and top with toppings of choice. Serve.</li></ol>	2022-11-17 14:02:22.531733	2022-11-17 14:08:55.030266	\N	25	4	\N	\N	\N	\N	American	f	t	t	f	f	f	f	f	f	f	f	f	f	f
11	8	Bacon Pancakes	Sample recipe found from: https://www.marthastewart.com/326883/bacon-pancakes	data:image/jpeg;base64,	published	<ol><li>Preheat oven to 200 degrees. In a bowl, whisk together flour, sugar, baking powder, baking soda, and salt. In another bowl, whisk together buttermilk, melted butter, and egg. Whisk flour mixture into buttermilk mixture just until moistened, with small to medium lumps remaining.&nbsp;<br>&nbsp;</li><li>In a large cast-iron or nonstick skillet or on a griddle, cook bacon over medium-high until fat is rendered and bacon is browned on one side, 5 to 6 minutes. Flip and cook until golden and crisp on underside, 1 to 3 minutes. Drain bacon on paper towels; pour off all but 1 teaspoon fat from skillet (reserve for another use).<br>&nbsp;</li><li>Heat skillet over medium. Pour 1/4-cupfuls batter into skillet and top each with a bacon slice. Cook until some bubbles appear on top of pancakes and a few have burst, about 2 minutes. With a spatula, carefully flip pancakes and cook until browned on underside, about 2 minutes. Transfer to a platter, bacon side up, and loosely tent with foil. Keep pancakes warm in oven and repeat with remaining batter, adding more bacon fat if needed. Serve with pure maple syrup, if desired.</li></ol>	2022-11-17 14:28:23.240513	2022-11-17 14:35:53.588792	\N	30	8	\N	\N	\N	\N	American	t	f	f	f	f	f	f	f	f	f	f	f	f	f
3	1	Rocket salad	Sample recipe found on: https://www.jamieoliver.com/recipes/vegetables-recipes/scrummy-warm-rocket-salad/\n\nNotes:\n- again some issues with not handling units, fractions etc	data:image/jpeg;base64,	published	<ol><li>Warm salads can be blooming amazing or a complete disaster. First, you have got to get your hungry guests around the table before you plate up, so as soon as their bums are on the chairs, you are tossing the warm ingredients in with the rocket leaves. Boom, boom, boom on a plate and it's in front of them.<br>&nbsp;</li><li>Peel, halve and quarter 2 medium red onions, then quarter again, to give you 8 pieces from each onion. Heat a frying pan and fry off 8 whole rashers of pancetta or smoked streaky bacon until crisp. Remove, add a couple of lugs of olive oil to the pan, and add 4 sprigs of thyme, the onions and a good handful of pine nuts with a tiny pinch of salt. Toss around and fry on a medium heat for about 5 minutes until caramelised and sweet (not black!).<br>&nbsp;</li><li>Put your pancetta or bacon back into the pan, toss around, then throw everything into a salad bowl with 4 big handfuls of rocket or any nice salad leaves. Drizzle generously with balsamic vinegar – this will make a natural dressing as it mixes with the olive oil. Serve with some shaved Parmesan over the top – you can use a potato peeler to do this. Munch away.</li></ol>	2022-11-08 14:18:38.966282	2022-11-17 16:20:38.526452	1	\N	4	\N	\N	\N	\N	Salad	f	t	t	f	f	f	f	f	f	f	f	t	t	f
